DROP TABLE IF EXISTS `t_permission`;
CREATE TABLE `t_permission` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `parent_id` int(11) DEFAULT NULL COMMENT '父节点id',
  `name` varchar(64) DEFAULT NULL COMMENT '权限名称',
  `code` varchar(64) DEFAULT NULL COMMENT '权限代码',
  `icon` varchar(64) DEFAULT NULL COMMENT '菜单前面的图标css',
  `url` varchar(128) DEFAULT NULL COMMENT '资源链接地址 - 生成菜单时使用',
  `target` int(1) DEFAULT NULL COMMENT '链接打开方式: 0内容区域打开 1新页面打开',
  `menu` int(1) DEFAULT NULL COMMENT '是否展示位菜单项',
  `status` int(1) DEFAULT NULL COMMENT '是否启用: 0禁用 1启用',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `description` varchar(64) DEFAULT NULL COMMENT '权限描述',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1101 DEFAULT CHARSET=utf8 COMMENT='权限表 - 资源+操作';

