--  Table structure for `t_user`
-- ----------------------------
DROP TABLE IF EXISTS `t_user`;
CREATE TABLE `t_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `avatar` varchar(128) DEFAULT NULL COMMENT '头像url',
  `user_name` varchar(255) DEFAULT NULL COMMENT '用户名',
  `salt` varchar(16) DEFAULT NULL COMMENT '盐',
  `password` varchar(64) DEFAULT NULL COMMENT '密码',
  `nick_name` varchar(64) DEFAULT NULL COMMENT '昵称',
  `real_name` varchar(64) DEFAULT NULL COMMENT '真实姓名',
  `phone` varchar(16) DEFAULT NULL COMMENT '手机号码',
  `last_login_time` datetime DEFAULT NULL COMMENT '最后登录时间',
  `login_times` int(11) DEFAULT NULL COMMENT '登录次数',
  `status` int(1) DEFAULT NULL COMMENT '状态 1可用，0禁用',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `u_idx_phone` (`phone`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=67040 DEFAULT CHARSET=utf8 COMMENT='用户表';

